PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?person ?netWorth ?personLabel WHERE {
  ?person wdt:P21 wd:Q6581072 ; wdt:P2218 ?netWorth .
  OPTIONAL {
    ?person rdfs:label ?personLabel .
    FILTER ( LANG( ?personLabel ) = "en" )
  }
  .
  FILTER ( ?netWorth >= 1000000000 )
}
ORDER BY DESC ( ?netWorth )

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?unmarried_count ( SUM( IF( ?gender = wd:Q6581072 , 1 , 0 ) ) AS ?female_count ) ( SUM( IF( ?gender = wd:Q6581097 , 1 , 0 ) ) AS ?male_count ) WHERE {
  {
    SELECT ?artist ( COUNT( ?partner ) AS ?unmarried_count ) ?gender WHERE {
      ?artist wdt:P106 wd:Q108289408 .
      OPTIONAL {
        ?artist wdt:P21 ?gender
      }
      OPTIONAL {
        ?artist wdt:P451 ?partner
      }
      FILTER ( ?gender = wd:Q6581072 || ?gender = wd:Q6581097 )
    }
    GROUP BY ?artist ?gender
  } UNION {
    SELECT ?artist ( COUNT( ?partner ) AS ?unmarried_count ) ?gender WHERE {
      ?artist wdt:P106 wd:Q713200 .
      OPTIONAL {
        ?artist wdt:P21 ?gender
      }
      OPTIONAL {
        ?artist wdt:P451 ?partner
      }
      FILTER ( ?gender = wd:Q6581072 || ?gender = wd:Q6581097 )
    }
    GROUP BY ?artist ?gender
  }
}
GROUP BY ?unmarried_count
ORDER BY ?unmarried_count

