PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX psv: <http://www.wikidata.org/prop/statement/value/>
PREFIX wikibase: <http://wikiba.se/ontology#>
SELECT ?company ?companyLabel ?revenue ?revenueUnit ?netProfit ?headquarters ?headquartersLabel ?revenueDate ( ROUND( ( ?netProfit / ?revenue ) * 100 ) / 100 AS ?profitMargin ) WHERE {
  ?company wdt:P31 / wdt:P279 * wd:Q4830453 .
  ?company wdt:P159 ?headquarters .
  FILTER ( ?headquarters = wd:Q213 ) FILTER ( ?company != wd:Q100707321 ) FILTER ( ?company != wd:Q12021780 ) OPTIONAL {
    ?company wdt:P2139 ?revenue
  }
  OPTIONAL {
    ?company p:P2139 ?revenueStmt .
    ?revenueStmt psv:P2139 ?revenueUnitNode .
    ?revenueUnitNode wikibase:quantityUnit ?revenueUnit
  }
  OPTIONAL {
    ?company wdt:P2295 ?netProfit
  }
  OPTIONAL {
    ?company p:P2139 ?revenueStmt2 .
    ?revenueStmt2 pq:P585 ?revenueDate
  }
  OPTIONAL {
    ?company rdfs:label ?companyLabel .
    FILTER ( LANG( ?companyLabel ) = "en" )
  }
  OPTIONAL {
    ?headquarters rdfs:label ?headquartersLabel .
    FILTER ( LANG( ?headquartersLabel ) = "en" )
  }
  FILTER ( BOUND( ?revenue ) && BOUND( ?netProfit ) && ?revenue > 0 )
}
ORDER BY ASC ( ?profitMargin )
LIMIT 20

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT DISTINCT ?country ?countryLabel ?roundedArea ?partOf ?partOfLabel WHERE {
  ?country wdt:P30 wd:Q46 ; wdt:P2046 ?area .
  FILTER NOT EXISTS {
    ?country wdt:P576 ?dissolved
  }
  .
  ?country rdfs:label ?countryLabel .
  OPTIONAL {
    ?country wdt:P131 ?partOf
  }
  .
  OPTIONAL {
    ?partOf rdfs:label ?partOfLabel
  }
  .
  FILTER ( datatype( ?area ) = xsd:decimal ) .
  BIND( ROUND( ?area ) AS ?roundedArea ) .
}
ORDER BY DESC ( ?roundedArea )

PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT DISTINCT ?entity ?population ?area ?date WHERE {
  VALUES ?entity {
    wd:Q884 wd:Q31057 wd:Q35555 wd:Q220982 wd:Q31063 wd:Q475038
  }
  ?entity wdt:P1082 ?population ; wdt:P2046 ?area .
  {
    SELECT ?entity ( MAX( ?date ) AS ?maxDate ) WHERE {
      ?entity p:P1082 ?statement .
      ?statement pq:P585 ?date
    }
    GROUP BY ?entity
  }
  .
  ?entity p:P1082 ?statement .
  ?statement pq:P585 ?maxDate .
  BIND( ?maxDate AS ?date )
}
ORDER BY ?entity

